import React from "react";
import Header from "./Components/Header";
import { Container, Form } from "react-bootstrap";
import Footer from "./Components/Footer";
import Menu from "./Components/Menu";
import "./assests/App.css";
import { MapContainer, TileLayer, GeoJSON } from "react-leaflet";
import L from "leaflet";
import "leaflet/dist/leaflet.css"; // Make sure to import the Leaflet CSS
import data from "./assests/map.geojson"

const App = () => {
  const data = {"type":"Feature","properties":{},"geometry":{"coordinates":[[[76.59930039208973,12.349441172293908],[76.59129489150996,12.325128076725946],[76.59614729888466,12.299940174098737],[76.59432897487477,12.269953335569568],[76.60853333398649,12.249512474937603],[76.63966904569082,12.249944054113556],[76.67703986721608,12.25516214583429],[76.70907124501133,12.275596874696518],[76.70373572079546,12.329484374990898],[76.67347709416572,12.351224621605297],[76.62725845018122,12.357713905120704],[76.59930039208973,12.349441172293908]]],
  "type":"Polygon"}}
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <Menu />
          <MapContainer center={[14.0, 77.22]} zoom={7} className="map-container">
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
            />
            <GeoJSON data={data} />
          </MapContainer>
        </Container>
      </main>
      <Footer />
    </>
  );
};

export default App;
